import React from 'react';
import './EmployeeTable.css';

function EmployeeTable() {

  const [employeeList, setEmployeeList] = React.useState(null);

  React.useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((employeeList) => {
        setEmployeeList(employeeList)
        console.log(employeeList[0]['first_name'])
      }
        );
  }, []);

  return (
      <table className="employee-table">
        <tr>
          <th>Check Box</th>
          <th>Customer ID</th>
          <th>First Name</th>
          <th>Last Name</th>
          <th>Email Address</th>
          <th>Role</th>
        </tr>
      { employeeList ?
        employeeList.map( obj => 
          <tr>
            <td>checkbox</td>
            <td>{obj.id}</td>
            <td>{obj.first_name}</td>
            <td>{obj.last_name}</td>
            <td>{obj.email_address}</td>
            <td>{obj.job}</td>
          </tr>  
        ) :
        <p>loading....</p>
      }
      </table>
  );
}

export default EmployeeTable;
